export const FlexCC = {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center'
};

export const FlexCenterColText = {
    ...FlexCC,
    flexDirection: 'column' as 'column',
    textAlign: 'center' as 'center'
};

export const HeightWidth = (height: string, width: string) => ({
    height: height,
    width: width
});
